script: |
  super -f text -I q7709.spq | sort > q7709.out

inputs:
  - name: q7709.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT + col2 * 92 - - 72 * 14 <= NULL OR ( + ( col1 ) + 31 ) NOT BETWEEN 43 AND NULL;
  - name: tab0

outputs:
  - name: q7709.out
    data: |
      97	1	99
